import React from 'react';
import './Portfolio.css';
import Colton from '../../images/colton.jpeg'


const Portfolio = ({id}) => {
    return(
            <div className = 'vh-100 w-100 center mt5' id={id}>
                <div className = 'w-75 center'>
                    <h1 className = 'tc pt5 fw5'>Portfolio</h1>
                    <div className = 'flex flex-wrap vh-75 ba'>
                    </div>
                </div>
                <div className = 'bb w-75 mt3'>
                </div>
            </div>
 );
}

export default Portfolio;
